function setSpeakerImage(n,t){let i=location.origin+"/api/speakers/"+t+"/image";fetch(i).then(function(n){if(n.ok)return n.blob()}).then(function(t){const i=URL.createObjectURL(t);n.src=i}).catch(function(n){console.log(n)})}function setSponsorImage(n,t){let i=location.origin+"/api/sponsors/"+t+"/image";fetch(i).then(function(n){if(n.ok)return n.blob()}).then(function(t){const i=URL.createObjectURL(t);n.src=i}).catch(function(n){console.log(n)})}